        // 存储中文字符及其对应的笔画
        private static Dictionary<string, int> _characterStrokes;

        // 读取字符串并提取字符和笔画数
        private static void LoadCharacterStrokes()
        {
            try
            {
                var lineArray = Lines.Split(new[] { '\n', '\r' }, StringSplitOptions.RemoveEmptyEntries);
                _characterStrokes = new Dictionary<string, int>(lineArray.Length);
                foreach (var line in lineArray)
                {
                    var parts = line.Split('|');
                    if (parts.Length != 3)
                    {
                        continue;
                    }

                    var character = parts[1];
                    if (int.TryParse(parts[2], out var strokes))
                    {
                        _characterStrokes[character] = strokes;
                    }
                }
            }
            catch (Exception ex)
            {
                Debug.LogError($"Error processing data: {ex.Message}");
            }
        }

        // 按照笔画数排序返回字符数组
        public static string[] GetCharactersByStrokeCount(string[] characters)
        {
            if (_characterStrokes == null)
            {
                LoadCharacterStrokes();
            }

            var sortedCharacters = characters
                .Where(c => _characterStrokes.ContainsKey(c)) // 过滤掉字典中不存在的字符
                .OrderBy(c => _characterStrokes[c]) // 按照笔画数排序
                .ToArray();

            return sortedCharacters;
        }
    }
